import React, { useState, useEffect } from 'react'
import './App.css'
import Box from './Custom/Box'

const StarWars = () => {
  const [characters, setCharacters] = useState({})
  const [loading, setLoading] = useState(false)
  const [hasError, setError] = useState({state: false, message: ''})
  //object has metadata like films and planets
  //consider how requests all update state

  const starship = {name: '', model: ''};
  const vehicles = {name: ''};
  const [characterMetadata, setMetadata] = useState({id: 0,films: [''], starships: [''], vehicles: ['']})
  const characterShape = ({ name, films, ...rest }) => ({ name })
  const shapeCharacterFilms = ({name, films,...rest}) => ({films})
  const shapeFilms = ({title,...rest}) => ({title})
  const shapeCharacterStarships = ({starships,...rest}) => ({ starships })
  const shapeCharacterVehicles = ({vehicles,...rest}) => ({ vehicles })
  const fetchCharacters = async () => {
    try {
      setLoading(true)


     const charactersToFetch = Array.from(Array(15))

     const promises = charactersToFetch.map(async (item, index, array) => await (await fetch(`https://swapi.co/api/people/${index+1}`)).json())

     const results = await Promise.all(promises)

     const shapedResults = results.map(result => characterShape(result))
      setCharacters([...shapedResults, ...(characters & characters.length > 0 ? characters : [] )])
      setLoading(false)
   } catch(e) {
      setError({state: true, message: e.message})
  }}
  const fetchCharacterMetadata = async (characterID) => {
    //Get character films..
    const result = await (await fetch(`https://swapi.co/api/people/${characterID+1}`)).json()
    console.log(result)
    const charFilms = shapeCharacterFilms(result)
    console.log(charFilms)
    const filmPromises = charFilms.map(async (item, index, array) => await (await fetch(`https://swapi.co/api/films/${index+1}`)).json())
    const filmResults = await Promise.all(filmPromises)
    const shapedFilms = filmResults.map(result => shapeFilms(result))
    setMetadata.films(shapedFilms)
    //Get starships..
    const charStarships = shapeCharacterStarships(result)
    const starshipPromises = charStarships.map(async (item, index, array) => await (await fetch(`https://swapi.co/api/starships/${index+1}`)).json())
    const starshipResults = await Promise.all(starshipPromises)
    const shapedStarships = starshipResults.map(result => shapedStarships(result))
    setMetadata.starships(shapedStarships)
    //Get character vehicles
    const charVehicles = shapeCharacterVehicles(result)
    const vehiclesPromises = charVehicles.map(async (item, index, array) => await (await fetch(`https://swapi.co/api/vehicles/${index+1}`)).json())
    const vehiclesResults = await Promise.all(vehiclesPromises)
    const shapedVehicles = vehiclesResults.map(result => shapedVehicles(result))
    setMetadata.vehicles(shapedVehicles)
  }

    useEffect(() => {
      fetchCharacters()
      //By default fetch Luke Skywalkers data
      fetchCharacterMetadata(0)
  },[]);



    return (
    <>
  {loading && <div>Loading</div>}
  {hasError && hasError.state &&
  <div>{hasError.message}</div>}
  {characters && characters.length > 0 && (
      <Box bg={'background'}>
        <div className={'Row-Div'}>
        {characters.map((character,index) =>
            <Box key={index}
            bg={'contentAreaBackground'}
            textAlign={'left'} p={1} px={4}
            onClick={setMetadata.id=1}>
            {character.name}
            </Box>)}
        </div>
        <div className={'Row-Div'}>
          <Box bg={'contentAreaBackground'}>
            {characterMetadata.films.map((metaData,index) =>
               <Box key={index}
                    bg={'contentAreaBackground'}
                    textAlign={'left'} p={1} px={4}>
                 {metaData.title}</Box>)}
            {characterMetadata.starships.map((metaData,index) =>
                <Box key={index}
                     bg={'contentAreaBackground'}
                     textAlign={'left'} p={1} px={4}>
                  {metaData.title}</Box>)}
            {characterMetadata.vehicles.map((metaData,index) =>
                <Box key={index}
                     bg={'contentAreaBackground'}
                     textAlign={'left'} p={1} px={4}>
                  {metaData.title}
                </Box>)}
          </Box>
        </div>
      </Box>
    )
  }
  </>
)
}


export { StarWars }
